// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import AllTodosIds from './AllTodosIds';
import AllTodosIdsAndTitles from './AllTodosIdsAndTitles';
import UnresolvedTodos from './UnresolvedTodos';
import ResolvedTodos from './ResolvedTodos';
import AllTodosIdsAndUserIds from './AllTodosIdsAndUserIds';
import ResolvedTodosWithUserIds from './ResolvedTodosWithUserIds';
import UnresolvedTodosWithUserIds from './UnresolvedTodosWithUserIds';

const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <Switch>
          <Route path="/all-todos-ids" component={AllTodosIds} />
          <Route path="/all-todos-titles" component={AllTodosIdsAndTitles} />
          <Route path="/unresolved-todos" component={UnresolvedTodos} />
          <Route path="/resolved-todos" component={ResolvedTodos} />
          <Route path="/all-todos-userids" component={AllTodosIdsAndUserIds} />
          <Route path="/resolved-todos-userids" component={ResolvedTodosWithUserIds} />
          <Route path="/unresolved-todos-userids" component={UnresolvedTodosWithUserIds} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
